package legacyb3.core;import legacyb3.util.EventMulticaster;import java.util.EventListener;public class AppEventMulticaster extends EventMulticaster implements AppListener {	    protected AppEventMulticaster(EventListener a, EventListener b) {		super(a, b);    }	public void appMessage(AppEvent e){		((AppListener)a).appMessage(e);		((AppListener)b).appMessage(e);	}	public void appProgress(AppEvent e){		((AppListener)a).appProgress(e);		((AppListener)b).appProgress(e);	}		public void appTime(AppEvent e){		((AppListener)a).appTime(e);		((AppListener)b).appTime(e);	}}